import React, { Component } from "react";

const headerStyle = {
background: 'black',
height: '300px',
fontSize: '20px'
}

class Header extends Component {

    render() {
        return (
            <header class={headerStyle}>Hei {this.props.name}</header>
        );
    }
}

export default Header;
